import React, { useState } from "react";
import Footer from "../components/footer/Footer";
import { NavLink } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import EditName from "../components/editeName/EditName";

const User = () => {
  const dispatch = useDispatch();
  const token =
    "Le token :  eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY2MjY3NWRlNDEyNTQxMjBiNGY5Nzk1OCIsImlhdCI6MTcxMzc5Njg1OCwiZXhwIjoxNzEzODgzMjU4fQ.0sFTYrMArdkEBuY0WIzXAGZFdmckV4tbOvtUzhr1QEM";
  const username = "nom user";
  const userName = useSelector((state) => state.user.userName);
  console.log("Nom du user ici :", userName);

  const [editMode, setEditMode] = useState(false);

  const handleEditClick = () => {
    setEditMode(!editMode);
  };

  return (
    <div>
      <nav className="main-nav">
        <NavLink to="/" className="main-nav-logo" href="./index.js">
          <img
            className="main-nav-logo-image"
            src="./img/argentBankLogo.png"
            alt="Argent Bank Logo"
          />
          <h1 className="sr-only">Argent Bank</h1>
        </NavLink>
        <div>
          {/* Affiche le nom d'utilisateur uniquement s'il est défini */}
          {userName && (
            <a className="main-nav-item" href="./user.html">
              <i className="fa fa-user-circle"></i>
              {userName}
            </a>
          )}
          <NavLink to="/" className="main-nav-item" href="./index.html">
            <i className="fa fa-sign-out"></i>
            Sign Out
          </NavLink>
        </div>
      </nav>
      <main className="main bg-dark">
        <div className="header">
          <h1>
            Welcome back
            <br />
            {/* Affiche le nom d'utilisateur uniquement s'il est défini */}
            {userName && userName}
          </h1>
          <button className="edit-button" onClick={handleEditClick}>
            Edit Name
          </button>
        </div>
        {/* Affiche le composant EditName si le mode d'édition est activé */}
        {editMode && <EditName />}
        <h2 className="sr-only">Accounts</h2>
        <section className="account">
          <section className="account">
            <div className="account-content-wrapper">
              <h3 className="account-title">Argent Bank Checking (x8349)</h3>
              <p className="account-amount">$2,082.79</p>
              <p className="account-amount-description">Available Balance</p>
            </div>
            <div className="account-content-wrapper cta">
              <button className="transaction-button">View transactions</button>
            </div>
          </section>
          <section className="account">
            <div className="account-content-wrapper">
              <h3 className="account-title">Argent Bank Savings (x6712)</h3>
              <p className="account-amount">$10,928.42</p>
              <p className="account-amount-description">Available Balance</p>
            </div>
            <div className="account-content-wrapper cta">
              <button className="transaction-button">View transactions</button>
            </div>
          </section>
          <section className="account">
            <div className="account-content-wrapper">
              <h3 className="account-title">Argent Bank Credit Card (x8349)</h3>
              <p className="account-amount">$184.30</p>
              <p className="account-amount-description">Current Balance</p>
            </div>
            <div className="account-content-wrapper cta">
              <button className="transaction-button">View transactions</button>
            </div>
          </section>
        </section>
      </main>
      <Footer />
    </div>
  );
};

export default User;
